import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Home from './Home';
import  HomePage  from './pages/pageHome';

import './App.css';


const App = () => (
  <Switch>
    <Route exact={true} path="/" component={Home} />
    <Route  path="/home" component={HomePage} />
  </Switch>
);

export default App;
